import { Routes, Route, Link } from "react-router-dom";
import HomePage from "./HomePage";
import Login from "./Login";

function Menu() {
    return (
        <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/login" element={<Login />} />
            {/* <Route path="/inscription" element={<Inscription />} /> */}
        </Routes>
    );
}

export default Menu;
